import { GET_CONTACTS, DELETE_CONTACT, ADD_CONTACT } from './types';

export const getContacts = () => {
  return {
    type: GET_CONTACTS
  };
};

export const deleteContacts = () => {
  return {
    type: DELETE_CONTACTS,
    payload: id
  };
};

export const addContacts = () => {
  return {
    type: ADD_CONTACTS
  };
};
